便器に直接ジェルをスタンプ！画期的なトイレクリーナー！<br>●トイレの水を流すたびに洗浄・防汚成分を便器全体に行き渡らせ、汚れを防いで、いつもピカピカに、清潔に保ちます。<br>●トイレの水が流れた後も、ジェルの働きで濡れている便器の表面に沿って、洗浄・防汚成分が全体に行き渡ります。<br>●製品1本で約6週間使用できます。<br>※水温や使用環境により異なることがあります。<br>●便器に直接貼り付けるタイプのトイレ用芳香洗浄剤なので、どんなタイプの洋式トイレにも使えます。<br>●清潔で爽やかなフレッシュソープの香り。<br><br>【成分】<br>水、ポリオキシエチレンアルキルエーテル、グリセリン、香料、ポリエチレングリコール、ポリマー、鉱油<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ジョンソン<br>シリーズ名：スクラビングバブル<br>内容量：38g×2個<br>液性：弱酸性<br>使用場所：洋式トイレの便器の内側<br>原産国：メキシコ<br><br>購入単位：1パック<br>配送種別：在庫品</p></td></tr></table><br><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/gentei.jpg alt=数量限定><br><font color=#FF0000>※数量限定のため、先着順での販売となります。<br> ご注文のタイミングによっては、完売となっている場合がございます。<br> その際はキャンセル扱いとさせていただきますので、予めご了承下さい。</font><br><br><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>FM9848 fm9848 4901609007680 ジョンソン じょんそん ジョンソン株式会社 JOHNSON Johnson johnson スクラビングバブル すくらびんぐばぶる トイレスタンプクリーナー といれすたんぷくりーなー トイレスタンプ といれすたんぷ クリーナー 2個パック 2個入り バブルくんブラシ付 限定 数量限定 トイレ掃除 トイレ用 トイレ用品 トイレ フレッシュソープ ふれっしゅそーぷ</font></td></tr></table><style type="text/css">
